b3dec90b3c94b76fa67e7570fbe25875e6ed744f.source:
mutation authUserLogin($email: String!) {
  authUserLogin(email: $email) {
    __typename
    ok
    error
    token {
      __typename
      accessToken
      refreshToken
    }
  }
}

