    __typename
    ok
    error
    profile_image_url
    nickname
    gender
    age_range
  }
}

04a7f83571acba225d94d0537794e6b57132d8f4.source:
mutation createAuthUser($nickName: String!, $avatar: String, $bio: String, $platformType: String!, $email: String!) {
  createAuthUser(
    nickName: $nickName
    avatar: $avatar
    bio: $bio
    platformType: $platformType
    email: $email
  ) {
    __typename
    ok
    error
  }
}

c1c85e1b61b7fc85fea2fdf9406facab1befba52.source:
mutation createUser($bio: String, $userName: String, $gender: String, $ageRange: String, $email: String!, $nickName: String!, $avatar: String, $password: String) {
  createUser(
    bio: $bio
    userName: $userName
    gender: $gender
    ageRange: $ageRange
    email: $email
    nickName: $nickName
    avatar: $avatar
    password: $password
  ) {
    __typename
    ok
    error
  }
}

30de38953cac6350da6892a91a0b857d2566b974.source:
mutation editUser($nickName: String, $bio: String, $avatar: Upload, $password: String, $gender: String, $ageRange: String) {
